function Title(props) {
  return (
    <div
      style={{
        width: "100%",
        color: "white",
        fontSize: 36,
        margin: 20,
      }}
    >
      {props.val}
    </div>
  );
}

function Description(props) {
  return (
    <div
      style={{
        width: "100%",
        color: "gray",
        fontSize: 14,
        margin: 20,
      }}
    >
      {props.val}
    </div>
  );
}
